import Shortener from "./components/sections/Shortener";
import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="background"></div>
      <div className="app-content">
        <Shortener />
      </div>
      <footer>
        <p>Footer Content</p>
      </footer>
    </div>
  );
}

export default App;
